INSERT INTO `club_team_team` VALUES (1,'Crossfit','CrossFit is a strength and conditioning brand that combines weightlifting, sprinting, gymnastics, powerlifting, kettlebell training, plyometrics, rowing, and medicine ball training. CrossFit contends that a healthy, fit person requires proficiency in each of ten general physical skills: cardiovascular/respiratory endurance, stamina, strength, flexibility, power, speed, agility, balance, coordination, and accuracy. It defines fitness as increased work capacity across all these domains and says its program achieves this by provoking neurologic and hormonal adaptations across all metabolic pathways.','2011-11-12 00:10:11','2011-11-12 00:10:11');
